【商品説明】：吸水材の中に天然色粒の下記抽出エキスから作られた消臭剤を配合しました。<br>安全かつ効果的ににおいのもとからその匂いを低減させます。<br><br>●しっかりした受け口がついているのでお子様やご婦人でも安心してご使用いただけます。<br>●使用後のニオイや漏れをチャックでシャットアウトできるので、とても衛生的です。<br>●柿抽出エキスから作られた消臭剤を吸水材に配合してあるので、消臭効果も抜群です。<br>●吸水材は固まった後でも便器に流せます。<br><br>吸水容量…８００ｍｌ<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
