1枚でまるごとしっかり拭ける、厚くて強いトイレのお掃除シート。99.99%※の除菌効果に、消臭効果もプラス。ほぐれやすく、安心してトイレに流せます。やさしく香るリラックスハーブの香り。半分サイズに切って使えるミシン目入り大判シート。フタがしっかり閉まる高密度設計だから、シートが乾きにくい。トイレ空間になじむシンプルなパッケージデザインと、場所を取らない縦置きのボックス型。※すべての菌を除去するわけではありません。使用上の注意●体を拭くためには使わないでください。●幼児の手の届く所、火気の近く、直射日光のあたるところ、高温になる場所には置かないでください。●使用後は手を洗ってください。荒れ性の方や長時間にわたる使用の場合は、ゴム手袋をはめてください。●ペンキやニスなどの塗装面、白木、桐、壁紙、ガラス面、金属などに使用する際は、目立たない箇所で変色・変質がないことをお確かめ上、お使いください。●つまりを避けるため、使用後は1枚ずつトイレに流してください。●乾燥を防ぐため、使用後は容器のフタをキチンと閉めてください。●なるべく開封後1ヶ月を目安にお使いください。●流さない時は、「燃やせるゴミ」として処理してください。●つめかえの際は、必ず[スコッティシートウォッシュforトイレット]つめかえ用を使用してください。<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
